    false,nt"url": null,nt"notes": "In accordance with the Aleutian Canada
    Goose Recovery Team's recommendations, an early spring release of geese was conducted
    on Amchitka Island, Alaska. One hundred twenty Aleutian Canada geese (Branta canadensis
    leucopareia) were released on May 20, 1980. Another individual was released May
    25th. This paper outlines activities prior to the release and throughout the summer.
    Special emphasis is given to the geese's movements, habits, and interaction with
    bald eagles (Haliaeetus leucocephalus).",nt"license_title": "License Not Specified",nt"extras":
